import { Button, HStack, Stack, Center } from "@chakra-ui/react";
import Profile from "../components/Profile";

const Header = () => {
  return (
    <Center>
      <Stack>
        <HStack>
          <Profile/>
          <Profile/>
        </HStack>
        <Button>Go!</Button>
      </Stack>
    </Center>
  );
};

export default Header;
